import {GoogleLogin} from 'react-google-login'
import './Signin.css'

export default function Signin() {
    const toggleClass = 'toggle'
    const studentsClass = 'students' 
    const othersClass = 'others'
    const studentSignin = () => {
        x.style.left="50px";
        y.style.left="450px";
        z.style.left="0";
    }
    const othersSignin = () => {
        x.style.left="-400px";
        y.style.left="50px";
        z.style.left="110px";
    }

    return (
        <>
        <div className="signin-container">
            
            <div className="signin-form">
                <div class="toggle-box">
                    <div className={toggleClass}></div>
                    <button type="button" className="toggle-btn" onClick={studentSignin}>Students</button>
                    <button type="button" className="toggle-btn" onClick={othersSignin}>Others</button>
                </div>


                <form action="" className={othersClass}>
                    <div className="form-group">
                        <label htmlFor="">Name</label>
                        <br/>
                        <input type="text" />
                    </div>
                    
                    <div className="form-group">
                        <label htmlFor="">Pass</label>
                        <br/>
                        <input type="password" />
                    </div>
                    <input type="button" value="signin" />
                </form>

                <div className={studentsClass}>
                    <GoogleLogin
                        className="signin-gg-btn"
                        clientId="658977310896-knrl3gka66fldh83dao2rhgbblmd4un9.apps.googleusercontent.com"
                    
                        
                        cookiePolicy={'single_host_origin'}
                    />
                </div>
                
            </div>
            
        </div>  
        </>
    )
}
